import React from 'react';

function Home(props) {
    const { data } = props;

    if (data) {
        console.log(data); // Log the 'data' value to the console
      }
    return (
        <div>
            yasise
            {data && (
                <div>
                    <h2>Data:</h2>
                    <div className="gallery">
      {data.map(item => (
          <img src={item.name} alt={`Image ${item.name}`} />
      ))}
    </div>
                </div>
            )}
        </div>
    );
}

export default Home;
